pragma solidity ^0.4.23;

library SafeMath {

  function mul(uint256 a, uint256 b) internal pure returns (uint256) {
    if (a == 0) return 0;
    uint256 c = a * b;
    require(c / a == b);
    return c;
  }

  function div(uint256 a, uint256 b) internal pure returns (uint256) {
    require(b > 0); // Solidity only automatically asserts when dividing by 0
    uint256 c = a / b;
    return c;
  }

  function sub(uint256 a, uint256 b) internal pure returns (uint256) {
    require(b <= a);
    uint256 c = a - b;
    return c;
  }

  function add(uint256 a, uint256 b) internal pure returns (uint256) {
    uint256 c = a + b;
    require(c >= a);
    return c;
  }

  function mod(uint256 a, uint256 b) internal pure returns (uint256) {
    require(b != 0);
    return a % b;
  }
}


contract Ownable {
  address public _owner;

  event OwnershipTransferred(
    address indexed previousOwner,
    address indexed newOwner
  );


  constructor() public {
    _owner = msg.sender;
  }


  function owner() public view returns(address) {
    return _owner;
  }


  modifier onlyOwner() {
    require(msg.sender == _owner);
    _;
  }

  function transferOwnership(address newOwner) public onlyOwner {
    _transferOwnership(newOwner);
  }

  function _transferOwnership(address newOwner) internal {
    require(newOwner != address(0));
    emit OwnershipTransferred(_owner, newOwner);
    _owner = newOwner;
  }
}

contract TRC20Interface {
    function totalSupply() public constant returns (uint);
    function balanceOf(address tokenOwner) public constant returns (uint balance);
    function allowance(address tokenOwner, address spender) public constant returns (uint remaining);
    function transfer(address to, uint tokens) public returns (bool success);
    function approve(address spender, uint tokens) public returns (bool success);
    function transferFrom(address from, address to, uint tokens) public returns (bool success);
    event Transfer(address indexed from, address indexed to, uint tokens);
    event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
}

contract MyGame {
    function takeProfit() external returns (bool);
}

contract Token is TRC20Interface, Ownable {
    using SafeMath for uint256;
    struct DividendDate {
        uint256 date;
        uint256 sum;
    }

    string public symbol; //token short name
    string public  name; //token full name
    uint256 public decimals; //decimals pointers
    uint256 private _totalSupply; // total token qty
    DividendDate[] public dividend_days;
    mapping (address => uint256) public freezeTime;


    uint256 public currentLvl; //current mining level
    uint256 public nextDividendTime; // take to give dividends
    uint256 public dividendPeriod;//time between periods
    uint256 public cost;//how much 1 coin cost
    uint256 public costGrow;//
    uint256 public currentPeriodMined;//how many tokens mined at current period


    uint256 private period_win; //period plus qty
    uint256 private period_lose; //period minus qty

    uint256 private dividendPercent = 100; //dividend percent
    uint256 private miningPercent = 100;//mining percent

    uint256 public totalMined; // total mined qty
    uint256 public totalFrozen; // total frozen token qty
    uint256 public totalReferral;//current total referrals
    uint256 public totalDividends;//current total referrals
    uint256[] public trxReferralPercents = [20,10,5];
    uint256[] public tokenReferralPercents = [100,30,10];

    address[] private contracts;

    mapping (address => uint256) private _balances; // user balance
    mapping (address => uint256) private frozen_balances; // user frozen balance
    mapping (address => uint256) private referral_token_balances; // user dividends balance

    mapping (address => uint256) private referral_balances; // user referral balance
    mapping (address => uint256) private dividend_balances; // user referral balance
    mapping (address => bool) private _contracts_allowed; // contracts can access this
    mapping (address => mapping (address => uint256)) private _allowed; //admin allows

    event dividendEvent(uint256 tokenPrice, uint256 nextDividendTime);
    event freezeEvent(address owner, uint256 value);
    event unFreezeEvent(address owner, uint256 value);
    event serverUnFreezeEvent(address owner, uint256 value, uint256 id);
    event cancelUnFreezeEvent(address owner, uint256 value, uint256 id);
    event dividendsPayout(address user, uint256 qty, uint256 date);
    event referralWithdrawal(address user, uint256 qty, uint8 coin);
    event dividendWithdrawal(address user, uint256 qty);

    event referralEvent(address user, address from, uint256 trxQty, uint256 tokenQty, uint256 trxAll, uint256 tokenAll);
    event userMinedTokenEvent(address user, uint256 qty);


    constructor() public {
        decimals = 6;
        _totalSupply = 100000000 * (10 ** uint256(decimals));
        symbol = "TNX";
        name = "Full Token Name";
        totalMined = 0;
        currentLvl = 1;
        cost = 999;
        costGrow = 10;
        totalFrozen = 0;
        period_win = 0;
        dividendPeriod = 180;//300 seconds
        nextDividendTime = now + dividendPeriod;
        currentPeriodMined = 0;
        _balances[_owner] = 0;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address owner) public view returns (uint256) {
         return (_balances[owner]);
    }

    function tokenBalances(address owner) public view returns (uint256, uint256, uint256) {
        return (_balances[owner], _allowed[address(this)][owner], frozen_balances[owner]);
    }

    function frozenOf(address owner) public view returns (uint256) {
        return frozen_balances[owner];
    }

    function referralOf(address owner) public view returns (uint256) {
        return referral_balances[owner];
    }

    function contractBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowed[owner][spender];
    }

    function transfer(address to, uint256 value) public returns (bool) {
        require(value <= _balances[msg.sender]);
        require(to != address(0));
        _balances[msg.sender] = _balances[msg.sender].sub(value);
        _balances[to] = _balances[to].add(value);
        emit Transfer(msg.sender, to, value);
        return true;
    }



    function approve(address spender, uint256 value) public returns (bool) {
        require(spender != address(0));
        _allowed[msg.sender][spender] = _allowed[msg.sender][spender].add(value);
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function transferFrom(address from, address to, uint256 value) public returns (bool) {
        require(value <= _balances[from]);
        require(value <= _allowed[from][msg.sender]);
        require(to != address(0));
        _balances[from] = _balances[from].sub(value);
        _balances[to] = _balances[to].add(value);
        _allowed[from][msg.sender] = _allowed[from][msg.sender].sub(value);
        emit Transfer(from, to, value);
        return true;
    }

    function sendTokens(address to, uint256 value, address[] ref) external returns (bool) {
        require(_contracts_allowed[msg.sender] == true);
        uint256 tokens_to_give = value/cost;
        uint256 tokens_for_owner = tokens_to_give*4/6;
        require(_totalSupply >= (totalMined + tokens_to_give + tokens_for_owner));

        _balances[address(this)] = _balances[address(this)].add(tokens_to_give);
        _allowed[address(this)][to] = _allowed[address(this)][to].add(tokens_to_give);
        totalMined = totalMined.add(tokens_to_give);
        totalMined = totalMined.add(tokens_for_owner);
        currentPeriodMined = currentPeriodMined.add(tokens_to_give);
        currentPeriodMined = currentPeriodMined.add(tokens_for_owner);
        emit userMinedTokenEvent(to, tokens_to_give);
        for(uint8 counter = 0; counter < 3; counter++) {
            if(ref[counter] != _owner) {
                uint trxVal = value*trxReferralPercents[counter]/10000;
                addReferral(ref[counter], trxVal);
                uint tokenVal = tokens_to_give*tokenReferralPercents[counter]/1000;
                tokens_for_owner = tokens_for_owner.sub(tokenVal);
                referral_token_balances[ref[counter]] = referral_token_balances[ref[counter]].add(tokenVal);
                emit referralEvent(ref[counter], to, trxVal, tokenVal, value, tokens_to_give);
            }
        }
        _balances[_owner] = _balances[_owner].add(tokens_for_owner);
        if(currentPeriodMined > 30000000) {
            currentLvl++;
            currentPeriodMined = 0;
            cost = 1000+50*currentLvl;
        }
        return true;
    }

    function sendWin(uint256 value) external returns (bool) {
        require(_contracts_allowed[msg.sender] == true);
        period_win = period_win.add(value);
        return true;
    }

    function sendLose(uint256 value) external returns (bool) {
        require(_contracts_allowed[msg.sender] == true);
        period_lose = period_lose.add(value);
        return true;
    }

    function changePeriod(uint256 value) public onlyOwner returns (uint256) {
        dividendPeriod = value;
        return dividendPeriod;
    }


    function grantExternal(address beneficiary, bool mode) public onlyOwner returns (bool) {
        _contracts_allowed[beneficiary] = mode;
        if(mode) {
            contracts.push(beneficiary);
        } else {
            for(uint i = 0; i < contracts.length; i++) {
                if(contracts[i] == beneficiary) { delete(contracts[i]);}
            }
        }
        return mode;
    }

    function checkExternal(address beneficiary) public view returns (bool) {
        return _contracts_allowed[beneficiary];
    }

    function addReferral(address to, uint256 value) internal returns (bool) {
        require(_contracts_allowed[msg.sender] == true);
        referral_balances[to] = referral_balances[to].add(value);
        totalReferral = totalReferral.add(value);
        period_lose = period_lose.add(value);
        return true;
    }

    function takeReferralTrx(uint256 value) public returns (bool) {
        require(address(this).balance >= referral_balances[msg.sender]);
        require(referral_balances[msg.sender] >= value);
        require(value > 1000000);
        msg.sender.transfer(value);
        referral_balances[msg.sender] = referral_balances[msg.sender].sub(value);
        totalReferral = totalReferral.sub(value);
        emit referralWithdrawal(msg.sender, value, 0);
        return true;
    }

    function takeReferralToken(uint256 value) public returns (bool) {
        require(address(this).balance >= referral_token_balances[msg.sender]);
        require(referral_token_balances[msg.sender] >= value);
        require(value > 1000000);
        msg.sender.transfer(value);
        referral_token_balances[msg.sender] = referral_token_balances[msg.sender].sub(value);
        totalReferral = totalReferral.sub(value);
        emit referralWithdrawal(msg.sender, value, 1);
        return true;
    }

    function resetDividends() public onlyOwner returns (uint256) {
        require(nextDividendTime <= now);
        nextDividendTime = now + dividendPeriod;
        uint256 res = 0;
        if(totalFrozen != 0 && period_win > period_lose) {
            uint256 diff = period_win - period_lose;
            res = diff*1000000/totalFrozen;
            period_win = 0;
            period_lose = 0;
        }
        for(uint i = 0; i < contracts.length; i++) {
            takeProfit(contracts[i]);
        }

        dividend_days.push(DividendDate(now, res));
        emit dividendEvent(res, nextDividendTime);
        return res;
    }






    function getInfo() public view onlyOwner returns (uint256, uint256, uint256, uint256, uint256, uint256, uint256, uint256) {
        return (totalMined, currentLvl, nextDividendTime, cost.mul(miningPercent).div(100), currentPeriodMined, period_win.mul(dividendPercent).div(100), period_lose.mul(dividendPercent).div(100), totalFrozen);
    }

    function moveTokensFrom(uint256 value) public returns (bool) {
        require(_allowed[address(this)][msg.sender] >= value);
        _balances[address(this)] = _balances[address(this)].sub(value);
        _balances[msg.sender] = _balances[msg.sender].add(value);
        _allowed[address(this)][msg.sender] = _allowed[address(this)][msg.sender].sub(value);
        return true;
    }

    function freezeToken(uint256 value) public returns (bool) {
        require(_balances[msg.sender] >= value);
        moveDividends(msg.sender);
        freezeTime[msg.sender] = now;
        _balances[msg.sender] = _balances[msg.sender].sub(value);
        frozen_balances[msg.sender] = frozen_balances[msg.sender].add(value);
        totalFrozen = totalFrozen.add(value);
        emit freezeEvent(msg.sender, value);
        return true;
    }

    function unfreezeToken(uint256 value) public returns (bool) {
        require(frozen_balances[msg.sender] >= value);
        moveDividends(msg.sender);
        _balances[msg.sender] = _balances[msg.sender].add(value);
        frozen_balances[msg.sender] = frozen_balances[msg.sender].sub(value);
        if(frozen_balances[msg.sender] > 0) {
            freezeTime[msg.sender] = now;
        } else {
            freezeTime[msg.sender] = 0;
        }
        totalFrozen = totalFrozen.sub(value);
        emit unFreezeEvent(msg.sender, value);
        return true;
    }

    function moveDividends(address sender) private {
        uint256 ft = freezeTime[sender];
        if(ft != 0) {
            uint256 res = 0;
            uint256 frozenQty = frozen_balances[sender];
            for(uint256 i = 0; i < dividend_days.length; i++) {
                if(dividend_days[i].date > ft) {
                    res = res.add(dividend_days[i].sum*frozenQty/1000000);
                }
            }
            dividend_balances[sender] = dividend_balances[sender].add(res);
        }
    }

    function changeTrxReferralPercent(uint8 index, uint256 to) public onlyOwner returns (uint256) {
        require(index >= 0 && index < 3);
        trxReferralPercents[index] = to;
        return trxReferralPercents[index];
    }

    function changeTokenReferralPercent(uint8 index, uint256 to) public onlyOwner returns (uint256){
        require(index >= 0 && index < 3);
        tokenReferralPercents[index] = to;
        return tokenReferralPercents[index];
    }

    function changeMiningPercent(uint256 to) public onlyOwner returns (uint256){
        require(to >= 1 && to <= 100);
        miningPercent = to;
        return miningPercent;
    }

    function changeDividendPercent(uint256 to) public onlyOwner returns (uint256){
        require(to >= 1 && to <= 100);
        dividendPercent = to;
        return dividendPercent;
    }

    function getReferralBalances(address user) view public returns (uint256, uint256) {
        return (referral_balances[user], referral_token_balances[user]);
    }

    function getDividendBalance(address sender) public view returns (uint256) {
        uint256 ft = freezeTime[sender];
        uint256 res = 0;
        if(ft != 0) {
            uint256 frozenQty = frozen_balances[sender];
            for(uint256 i = 0; i < dividend_days.length; i++) {
                if(dividend_days[i].date > ft) {
                    res = (res.add(dividend_days[i].sum*frozenQty/1000000));
                }
            }
        }
        return (dividend_balances[sender] + res);
    }

    function withdrawDividends(uint256 value) public {
        require(address(this).balance >= value);
        moveDividends(msg.sender);
        freezeTime[msg.sender] = now;
        require(dividend_balances[msg.sender] >= value);
        msg.sender.transfer(value);
        dividend_balances[msg.sender] = dividend_balances[msg.sender].sub(value);
        emit dividendWithdrawal(msg.sender, value);
    }

    function takeProfit(address beneficiary) internal returns (bool) {
        MyGame c = MyGame(beneficiary);
        return c.takeProfit();
    }
}
